import React from 'react';
import { Button } from 'react-bootstrap';

const HeroSection = ({ headline = "Избери, резервирай и провери своят автомобил Лесно", subheadline = "Най-сигурната проверка на автомобили!", buttonText = "Запиши се" }) => {
  return (
    <div style={{ 
      width: '100%',
      maxWidth: '636px',
      minHeight: '348px',
      display: 'flex',
      flexDirection: 'column',
      gap: '20px',
      padding: '20px'
    }}>
      <div style={{
        fontFamily: 'Poppins',
        fontSize: '48px',
        fontWeight: 600,
        lineHeight: '100%',
        color: '#1572d3'
      }}>
        {headline}
      </div>

      <div style={{
        fontFamily: 'Poppins',
        fontSize: '18px',
        fontWeight: 400,
        lineHeight: '150%',
        color: '#272727'
      }}>
        {subheadline}
      </div>

      <Button
        style={{
          width: '253px',
          height: '35px',
          padding: '8px',
          backgroundColor: '#1572d3',
          border: 'none',
          borderRadius: '8px',
          fontFamily: 'Poppins',
          fontSize: '16px',
          fontWeight: 700,
          lineHeight: '150%',
          color: '#ffffff',
          textTransform: 'uppercase',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          cursor: 'pointer',
          transition: 'background-color 0.3s'
        }}
        onMouseOver={(e) => e.target.style.backgroundColor = '#1260b3'}
        onMouseOut={(e) => e.target.style.backgroundColor = '#1572d3'}
      >
        {buttonText}
      </Button>

      <div style={{
        width: '259px',
        height: '36.62px',
      }}>
        <img 
          src="https://dashboard.codeparrot.ai/api/image/Z7O5HTO_YEiK21yL/frame-2-2.png"
          alt="Frame"
          style={{
            width: '100%',
            height: '100%',
            objectFit: 'contain'
          }}
        />
      </div>
    </div>
  );
};

export default HeroSection;
